                        lack of performance in comparison to other companies.
                        </p>
                    </div></Fade>
                    <div className='feedBackImages'>

                       <video autoPlay loop className = "smallDesktop" id ="videosFeedback">
                         <source src = {desktopPrev}></source>
                       </video>

                       <video autoPlay loop className="smallPhone" id ="videosFeedback">
                         <source src = {mobilePrev}></source>
                       </video>


                    </div>
                </div>

            </div>
        );
    }
}

export default Two;
